Note: The line on the initial picture is from the initial gun insertion. The holster os unworn.

I am selling a BRAND NEW and UNWORN Minotaur MTAC Inside Waistband Holster for the Glock 29/30 Series Firearms. I purchased it for my Glock 30SF and no longer need.

Interchangeable Spare Bodies
The Minotaur MTAC is the ultimate level of deep concealment on the market today. This "hybrid" holster combines cowhide leather backing with a Kydex half-shell mounted on the leather. The leather backing provides the desired comfort achieved by leather holsters. The Kydex half-shell provides the reliable, consistent draw and re-holstering capabilities that make Kydex holsters so popular.

Interchangeable Spare Bodies -- One holster for all your guns!
The Kydex half-shell (also called "Spare Body") on this model is interchangeable and can be swapped out for different handguns. Click here to see more on our Minotaur Spare Bodies.

Adjustable Cant and Ride Depth
The clips on the MTAC can be re-positioned to ride higher or lower on the holster. This allows the cant (angle) to be adjusted more or less depending on user preference. The ride depth can also be adjusted in the same manner.

Interchangeable Clips
The clips can be swapped out for different styles, colors, and belt widths. For more information on available clips, please see our Mounting Options page.

Leather Backing Notice
Leather is a natural material and shades may vary from hide to hide. We do fit check EVERY holster with the actual pistol. Due to this fit process, there may be small scuffs on the inside of the holster. This is normal and caused by the fit process.

